import React from "react";
import { Route, BrowserRouter as Router, Switch } from "react-router-dom";
import Header from "./components/Header";
import Home from "./components/Home";
import Link2 from "./components/Link2";
import Link3 from "./components/Link3";
import Link4 from "./components/Link4";
import Link5 from "./components/Link5";
import Link6 from "./components/Link6";
import Link7 from "./components/Link7";

function App() {
  return (
    <Router>
      <div>
        <Header />
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/link2" component={Link2} />
          <Route path="/link3" component={Link3} />
          <Route path="/link4" component={Link4} />
          <Route path="/link5" component={Link5} />
          <Route path="/link6" component={Link6} />
          <Route path="/link7" component={Link7} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
